function getUsuario(n,t){$.ajax({type:"POST",url:t,data:{id:n},success:function(n){mostrarUsuario(n)}})}function mostrarUsuario(n){var t,i;for(items=n,j=0,t=0;t<3;t++)i=document.getElementById("Select"),i.remove(t);$.each(items,function(n,t){$("input[name=Id]").val(t.id);$("input[name=UserName]").val(t.userName);$("input[name=Email]").val(t.email);document.getElementById("Select").options[0]=new Option(t.role,t.roleId)})}function getRoles(n){$.ajax({type:"POST",url:n,data:{},success:function(n){if(j===0){for(var t=0;t<n.length;t++)document.getElementById("Select").options[t]=new Option(n[t].text,n[t].value);j=1}}})}function editarUsuario(n){id=$("input[name=Id]")[0].value;email=$("input[name = Email]")[0].value;role=document.getElementById("Select");selectRole=role.options[role.selectedIndex].text;$.each(items,function(n,t){accessFailedCount=t.accessFailedCount;concurrencyStamp=t.concurrencyStampc;lockoutEnabled=t.lockoutEnabled;lockoutEnd=t.lockoutEnd;normalizedUserName=t.normalizedUserName;normalizedEmail=t.normalizedEmail;passwordHash=t.passwordHash;PhoneNumberConfirmed=t.PhoneNumberConfirmed;securityStamp=t.securityStamp;twoFactorEneable=t.twoFactorEneable;phoneNumber=t.phoneNumber;userName=t.userName;emailConfirmed=t.emailConfirmed});$.ajax({type:"POST",url:n,data:{id,userName,email,phoneNumber,accessFailedCount,concurrentStamp,emailConfirmed,lockoutEneable,lockoutEnd,NormalizedEmail,NormalizedUserName,passwordHash,phoneNumberConfirmed,securityStamp,twoFactorEneable,selectRole},success:function(n){alert("hola");n==="Save"?window.location.href="Usuarios":alert("no se puede editar los datos del usuario")}})}$("#modalEditar").on("shown.bs.modal",function(){$("#myInput").focus()});var items,j=0,id,userName,email,role,selectRole,nombre,apellido,dni,accessFailedCount,concurrencyStamp,lockoutEnabled,lockoutEnd,normalizedUserName,normalizedEmail,passwordHash,PhoneNumberConfirmed,securityStamp,twoFactorEneable,phoneNumber,emailConfirmed;